import React, { createContext } from 'react';

export const AuthContext = createContext({});

export function AuthProvider({ children }) {
    const CoinsPrice = {
        price: '1500',
        price: '20',
    };
    return (
        <AuthContext.Provider value={CoinsPrice}>
            {children}
        </AuthContext.Provider>
    );
}
